"""Eine rechtsschiefe Verteilung ist bei Verkaufsdaten h√§ufig zu finden, da die meisten Kunden nur eine kleine Menge eines Produkts kaufen, w√§hrend sehr gro√üe Eink√§ufe (wie etwa ein Gro√üeinkauf f√ºr ein Unternehmen) selten sind.

Die **Schiefe (Skewness)** misst die **Asymmetrie einer Verteilung**.

* **Positive Schiefe (> 0):** Die Verteilung hat einen langen "Schwanz" nach rechts. Das bedeutet, dass die Mehrheit der Datenwerte am unteren Ende liegt und es einige extrem hohe Werte gibt.
* **Negative Schiefe (< 0):** Die Verteilung hat einen langen "Schwanz" nach links. Das bedeutet, dass die Mehrheit der Datenwerte am oberen Ende liegt und es einige extrem niedrige Werte gibt.
* **Keine Schiefe (= 0):** Die Verteilung ist perfekt symmetrisch, wie eine Normalverteilung (Glockenkurve).

Neben der Skewness gibt es noch die Kurtosis. Beide sind statistische Ma√üe, die uns helfen, die Form einer Verteilung genauer zu beschreiben.
Die **W√∂lbung (Kurtosis)** beschreibt die "Schwanzlastigkeit" oder **Spitzigkeit einer Verteilung**. Sie gibt an, wie stark die Daten in den Enden (den "Schw√§nzen") der Verteilung konzentriert sind im Vergleich zu einer Normalverteilung.

* **Positive Kurtosis (> 0):** Die Verteilung ist **spitzer** als eine Normalverteilung und hat **schwerere (dickere) Schw√§nze**. Das bedeutet, dass es mehr Ausrei√üer gibt.
* **Negative Kurtosis (< 0):** Die Verteilung ist **flacher** als eine Normalverteilung und hat **leichtere (d√ºnnere) Schw√§nze**. Die Daten sind weniger stark in der Mitte und in den Extremen konzentriert.
* **Keine Kurtosis (= 0):** Die Verteilung hat eine W√∂lbung, die einer Normalverteilung entspricht.

Zusammengefasst: W√§hrend ein Histogramm die Form einer Verteilung visuell darstellt, liefern Schiefe und W√∂lbung **pr√§zise, quantifizierbare Werte**, um diese Form statistisch zu untermauern und zu vergleichen.
"""

# using skewness and kurtosis as a statistical add to the above histogram to the shape of the distribution
# Using skewness and kurtosis as statistical measures to describe the shape of the distribution in addition to the histogram above.
print("Skewness: %f" % data['SalesAmount'].skew()) # Calculate and print the skewness of the 'SalesAmount' column. Skewness measures the asymmetry of the distribution.
print("Kurtosis: %f" % data['SalesAmount'].kurt()) # Calculate and print the kurtosis of the 'SalesAmount' column. Kurtosis measures the "tailedness" of the distribution.

"""Der Wert der Schiefe ist positiv, da der Rand der Verteilung auf der rechten Seite der Kurve l√§nger ist. Die Verteilung ist nicht symmetrisch. Die Kurtosis ist ein Ma√ü daf√ºr, ob die Daten im Vergleich zu einer Normalverteilung schwer- oder leichtverteilte R√§nder aufweisen. Das hei√üt, Datens√§tze mit hoher Kurtosis neigen dazu, schwere R√§nder oder Ausrei√üer zu haben.  """

# just for the fun of it -and for learning purposes- we can achieve the same result if we add the function to a variable name (case sensitive!)
# Just for learning purposes, we can assign the result of the skew() function to a variable.
# Select only numerical columns before calculating skewness
# Select only the columns with numerical data types before calculating skewness.
numerical_data = data.select_dtypes(include=['float64', 'int64'])
SkewValue = numerical_data.skew() # Calculate the skewness for each numerical column and store it in the SkewValue variable.
print("SkewValue of dataframe attributes: ", SkewValue) # Print the SkewValue variable to display the skewness of each numerical column.

