"""# Box Plots

Ein Box Plot (auch Kastengrafik genannt) ist eine **grafische Darstellung, die einen schnellen √úberblick √ºber die Verteilung von Daten bietet**. Er zeigt, wie Daten in vier Abschnitte (Quartile) aufgeteilt sind. Man verwendet ihn oft, um Datens√§tze zu vergleichen oder um Ausrei√üer zu identifizieren.



Ein Box Plot besteht aus f√ºnf Hauptwerten, die zusammengefasst die ‚Äû**F√ºnf-Zahlen-Zusammenfassung**‚Äú genannt werden:

* **Median (der mittlere Strich in der Box):** Dieser Wert teilt die Daten in zwei H√§lften. Genau die H√§lfte der Daten liegt unter dem Median und die andere H√§lfte dar√ºber.
* **Erstes Quartil (Q1):** Die linke Kante der Box. 25% der Daten sind kleiner oder gleich diesem Wert.
* **Drittes Quartil (Q3):** Die rechte Kante der Box. 75% der Daten sind kleiner oder gleich diesem Wert.
* **Minimum:** Der kleinste Wert im Datensatz, der kein Ausrei√üer ist. Er wird durch das linke Ende des ‚ÄûSchnurrhaars‚Äú dargestellt.
* **Maximum:** Der gr√∂√üte Wert im Datensatz, der kein Ausrei√üer ist. Er wird durch das rechte Ende des ‚ÄûSchnurrhaars‚Äú dargestellt.

Die **Box selbst (der Kasten)** repr√§sentiert die mittleren 50% der Daten, also den Bereich zwischen dem ersten (Q1) und dem dritten Quartil (Q3). Dieser Bereich wird auch als **Interquartilsabstand (IQR)** bezeichnet.



### Wie liest man einen Box Plot?

* **Der Median:** Die Position des Medianstrichs in der Box zeigt, ob die Daten symmetrisch oder schief verteilt sind. Liegt er genau in der Mitte, ist die Verteilung symmetrisch. Ist er n√§her an Q1, sind die Daten rechts-schief verteilt; ist er n√§her an Q3, sind sie links-schief verteilt.
* **Die Box:** Eine lange Box bedeutet, dass die mittleren 50% der Daten weit gestreut sind, w√§hrend eine kurze Box auf eine dichte Konzentration hindeutet.
* **Die "Schnurrhaare" (Whisker):** Die L√§nge der Linien, die aus der Box herausragen, gibt Aufschluss √ºber die Streuung der restlichen Daten.
* **Ausrei√üer:** Werte, die weit au√üerhalb der Schnurrhaare liegen, werden oft als Punkte oder Sterne dargestellt und gelten als Ausrei√üer. Sie sind Datenpunkte, die signifikant von den anderen Werten abweichen.  

Wer m√∂chte, findet [hier](https://datatab.de/tutorial/boxplot) gute weiterf√ºhrende Erl√§uterungen zu Box Plots.
"""

import plotly.express as px
