"""## Korrelationsmatrix

Eine **Korrelationsmatrix** ist eine Tabelle, die die Korrelationskoeffizienten zwischen verschiedenen Variablen in einem Datensatz anzeigt. Die Matrix ist symmetrisch, d.h. die Korrelation zwischen Variable A und B ist dieselbe wie die zwischen B und A. Sie hilft, schnell zu erkennen, welche Variablen stark miteinander in Beziehung stehen (positiv oder negativ) und welche nicht.

Korrelationskoeffizienten sind **numerische Ma√üe, die die St√§rke und Richtung der linearen Beziehung zwischen zwei Variablen quantifizieren**. Sie liegen immer in einem Bereich von -1 bis +1.

---

## Arten und Bedeutung

Es gibt verschiedene Arten von Korrelationskoeffizienten, wobei der **Pearson-Korrelationskoeffizient** ($r$) am h√§ufigsten verwendet wird.

* **Positive Korrelation (Werte nahe +1):** Wenn eine Variable steigt, steigt auch die andere.
* **Negative Korrelation (Werte nahe -1):** Wenn eine Variable steigt, sinkt die andere.
* **Keine Korrelation (Werte nahe 0):** Es gibt keine lineare Beziehung zwischen den Variablen.

Es ist wichtig zu verstehen, dass Korrelation **keine Kausalit√§t** impliziert. Nur weil zwei Variablen korrelieren, bedeutet das nicht, dass eine die Ursache f√ºr die andere ist.

---

## Beispiel einer Korrelationsmatrix

Stellen Sie sich vor, wir haben Daten √ºber das Alter, die K√∂rpergr√∂√üe und das Einkommen von Personen. Eine Korrelationsmatrix w√ºrde die paarweisen Korrelationen zwischen diesen Variablen darstellen.

| | Alter | K√∂rpergr√∂√üe | Einkommen |
| :--- | :--- | :--- | :--- |
| **Alter** | 1.00 | 0.25 | 0.65 |
| **K√∂rpergr√∂√üe** | 0.25 | 1.00 | 0.10 |
| **Einkommen** | 0.65 | 0.10 | 1.00 |

* **Alter und Einkommen (0.65):** Es gibt eine **moderate positive Korrelation**. Dies k√∂nnte darauf hindeuten, dass mit steigendem Alter auch das Einkommen tendenziell steigt.
* **Alter und K√∂rpergr√∂√üe (0.25):** Es gibt eine **sehr schwache positive Korrelation**. Alter und K√∂rpergr√∂√üe haben keine starke lineare Beziehung zueinander.
* **K√∂rpergr√∂√üe und Einkommen (0.10):** Es gibt **fast keine Korrelation**. Es gibt kaum eine lineare Beziehung zwischen der K√∂rpergr√∂√üe und dem Einkommen einer Person.

Die Werte auf der **Diagonale** sind immer 1.00, da jede Variable perfekt mit sich selbst korreliert. Die Matrix ist symmetrisch, d.h., der Wert f√ºr Alter-Einkommen (0.65) ist derselbe wie f√ºr Einkommen-Alter.
"""

# Wir selektieren nur die numerischen Spalten, da Korrelationen nur f√ºr diese berechnet werden k√∂nnen.
numeric_data = data.select_dtypes(include=['float64', 'int64'])

# Berechnung der Korrelationsmatrix
correlation_matrix = numeric_data.corr()

# Einstellung der Figure-Gr√∂√üe f√ºr bessere Lesbarkeit
plt.figure(figsize=(10, 8))

# Erstellung der Heatmap
# 'annot=True' zeigt die Korrelationswerte in den Zellen an.
# 'cmap='coolwarm'' w√§hlt ein Farbschema, das positive Korrelationen blau und negative rot f√§rbt.
sns.heatmap(correlation_matrix, annot=True, cmap='coolwarm', fmt=".2f", linewidths=.5)

# Titel hinzuf√ºgen
plt.title('Korrelationsmatrix der numerischen Variablen')

# Speichern der Grafik
plt.savefig('correlation_matrix.png')
print("Die Korrelationsmatrix als DataFrame:")
print(correlation_matrix)

"""# Aufgabe: Welche Erkenntnisse ziehen Sie aus dieser Matrix?"""

# Tragen Sie hier Ihre Gedanken dazu ein...

"""
Das **Pairplot** Diagramm ist eine visuelle Erweiterung einer Korrelationsmatrix und dient dazu, die Beziehungen zwischen allen numerischen Variablen eines Datensatzes gleichzeitig darzustellen.


* `sns.pairplot(data, diag_kind="kde")`: Dies ist der Hauptbefehl. Er erzeugt ein Gitter von Unterdiagrammen.
    * `data`: Das `pairplot` w√§hlt automatisch alle numerischen Spalten aus.
    * `diag_kind="kde"`: Dieser Parameter steuert, was auf der **Diagonale** des Gitters angezeigt wird.
        * `kde` steht f√ºr **Kernel Density Estimate**, eine Methode zur Darstellung der Verteilung einer einzelnen Variable. Anstatt eines einfachen Histogramms zeigt die KDE-Kurve eine gegl√§ttete, kontinuierliche Sch√§tzung der Verteilung.

"""

